import React from 'react';
import Navbar from '../components/Navbar/Navbar';
import "../Cart.scss"

const Cart = () => {
    return <main className="cart">
        <Navbar />
        <h1>Cart</h1>
        <div>
            <span>Picture</span>
            <span>Name</span>
            <span>Category</span>
            <span>Price</span>
            <span>Quantity</span>
            <span>Total</span>
        </div>
    </main>;
};

export default Cart;
